{
  "class_id": "0x06",
  "message_id": "0x61",
  "name": "UBX-CFG-DOSC",
  "description": "Disciplined oscillator configuration",
  "message_type": "get_set",
  "payload_length": {
    "variable": {
      "base": 4,
      "formula": "4 + numOsc * 32"
    }
  },
  "payload": [
    {
      "byte_offset": 0,
      "name": "version",
      "data_type": "U1",
      "description": "Message version (0x00 for this version)",
      "fixed_value": 0
    },
    {
      "byte_offset": 1,
      "name": "numOsc",
      "data_type": "U1",
      "description": "Number of oscillators to configure (affects length of this message)"
    },
    {
      "byte_offset": 2,
      "name": "reserved1",
      "data_type": {
        "array_of": "U1",
        "count": 2
      },
      "description": "Reserved",
      "reserved": true
    },
    {
      "byte_offset": 4,
      "name": "repeated_block",
      "description": "Oscillator configuration block, repeated numOsc times",
      "repeats": {
        "count_field": "numOsc",
        "block_length": 32
      },
      "fields": [
        {
          "byte_offset": 0,
          "name": "oscId",
          "data_type": "U1",
          "description": "Id of oscillator. 0 - internal oscillator, 1 - external oscillator"
        },
        {
          "byte_offset": 1,
          "name": "reserved2",
          "data_type": "U1",
          "description": "Reserved",
          "reserved": true
        },
        {
          "byte_offset": 2,
          "name": "flags",
          "data_type": "X2",
          "description": "flags",
          "bitfield": [
            {
              "name": "isCalibrated",
              "bits": 1,
              "description": "1 if the oscillator gain is calibrated, 0 if not",
              "bit_offset": 0
            },
            {
              "name": "controlIf",
              "bits": 4,
              "description": "Communication interface for oscillator control: 0: Custom DAC attached to receiver's I2C, 1: Microchip MCP4726 (12 bit DAC) attached to receiver's I2C, 2: TI DAC8571 (16 bit DAC) attached to receiver's I2C, 13: 12 bit DAC attached to host, 14: 14 bit DAC attached to host, 15: 16 bit DAC attached to host",
              "bit_offset": 1
            }
          ]
        },
        {
          "byte_offset": 4,
          "name": "freq",
          "data_type": "U4",
          "description": "Nominal frequency of source",
          "scale": {
            "raw": "2^-2",
            "multiplier": 0.25
          },
          "unit": "Hz"
        },
        {
          "byte_offset": 8,
          "name": "phaseOffset",
          "data_type": "I4",
          "description": "Intended phase offset of the oscillator relative to the leading edge of the time pulse",
          "unit": "ps"
        },
        {
          "byte_offset": 12,
          "name": "withTemp",
          "data_type": "U4",
          "description": "Oscillator stability limit over operating temperature range (must be > 0)",
          "scale": {
            "raw": "2^-8",
            "multiplier": 0.00390625
          },
          "unit": "ppb"
        },
        {
          "byte_offset": 16,
          "name": "withAge",
          "data_type": "U4",
          "description": "Oscillator stability with age (must be > 0)",
          "scale": {
            "raw": "2^-8",
            "multiplier": 0.00390625
          },
          "unit": "ppb/year"
        },
        {
          "byte_offset": 20,
          "name": "timeToTemp",
          "data_type": "U2",
          "description": "The minimum time that it could take for a temperature variation to move the oscillator frequency by 'withTemp' (must be > 0)",
          "unit": "s"
        },
        {
          "byte_offset": 22,
          "name": "reserved3",
          "data_type": {
            "array_of": "U1",
            "count": 2
          },
          "description": "Reserved",
          "reserved": true
        },
        {
          "byte_offset": 24,
          "name": "gainVco",
          "data_type": "I4",
          "description": "Oscillator control gain/slope; change of frequency per unit change in raw control change",
          "scale": {
            "raw": "2^-16",
            "multiplier": 0.0000152587890625
          },
          "unit": "ppb/raw LSB"
        },
        {
          "byte_offset": 28,
          "name": "gainUncertainty",
          "data_type": "U1",
          "description": "Relative uncertainty (1 standard deviation) of oscillator control gain/slope",
          "scale": {
            "raw": "2^-8",
            "multiplier": 0.00390625
          }
        },
        {
          "byte_offset": 29,
          "name": "reserved4",
          "data_type": {
            "array_of": "U1",
            "count": 3
          },
          "description": "Reserved",
          "reserved": true
        }
      ]
    }
  ]
}
